fetch("https://api.github.com/repos/Delusoire/spicetify-extensions/contents/dist/spoqify-radios/app.js")
    .then(res => res.json())
    .then(json => atob(json.content))
    .then(content => new Blob([content], { type: "application/javascript" }))
    .then(URL.createObjectURL)
    .then(url => import(url))